import React, { useState } from 'react';
import { Navbar, Nav, Container, Modal } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import { useDispatch, useSelector } from 'react-redux';
import { logout } from '../actions/userActions';

// reuse your existing input component for searching
import SearchBarForProducts from './SearchBarForProducts';

// ---- Header with two tiers: brandbar (logo + icons) + navstrip (links)
function NavBar() {
  const dispatch = useDispatch();
  const { userInfo } = useSelector((state) => state.userLoginReducer);

  // search modal
  const [showSearch, setShowSearch] = useState(false);
  const openSearch = () => setShowSearch(true);
  const closeSearch = () => setShowSearch(false);

  const logoutHandler = () => {
    dispatch(logout());
    // optional: window.location.reload();
  };

  return (
    <header className="site-header">
      {/* ========== TOP BRAND BAR (logo + right-side icons) ========== */}
      <div className="brandbar">
        <Container>
          <div className="brandbar-inner">
            {/* left area (keep empty or add language later) */}
            <div className="brandbar-left" />

            {/* centered logo */}
            <div className="brandbar-logo">
              {/* Put your logo file into /public/logo.svg or change the src */}
              <a href="/" className="d-inline-block" aria-label="Home">
                <img className="brand-logo-img" src="/logo.svg" alt="Shop logo" />
              </a>
            </div>

            {/* right side icons */}
            <div className="brandbar-icons">
              {/* search icon => opens modal */}
              <button
                className="icon-link btn p-0"
                aria-label="Search"
                onClick={openSearch}
                title="Search"
              >
                <i className="fas fa-search" />
              </button>

              {/* wishlist */}
              <LinkContainer to="/wishlist">
                <a className="icon-link" aria-label="Wishlist" title="Wishlist">
                  <i className="fas fa-heart" />
                </a>
              </LinkContainer>

              {/* cart */}
              <LinkContainer to="/cart">
                <a className="icon-link" aria-label="Cart" title="Cart">
                  <i className="fas fa-shopping-bag" />
                </a>
              </LinkContainer>

              {/* remove the person/user icon (hidden by design) */}
              {/* If you do want a tiny admin link, you can keep this one: */}
              {userInfo && userInfo.admin && (
                <LinkContainer to="/new-product/">
                  <a className="icon-link" title="Add product">
                    <i className="fas fa-plus-square" />
                  </a>
                </LinkContainer>
              )}
            </div>
          </div>
        </Container>
      </div>

      {/* ========== NAV STRIP (links only â€“ no inline search anymore) ========== */}
      <Navbar className="navstrip" expand="lg" variant="light">
        <Container>
          <Navbar.Toggle aria-controls="main-nav" />
          <Navbar.Collapse id="main-nav">
            <Nav className="mx-auto">
              <LinkContainer to="/">
                <Nav.Link className="nav-link-upp">Welcome</Nav.Link>
              </LinkContainer>

              <LinkContainer to="/products">
                <Nav.Link className="nav-link-upp">All Products</Nav.Link>
              </LinkContainer>

              {/* keep brand/about style items as you had */}
              <LinkContainer to="/brands">
                <Nav.Link className="nav-link-upp">Brands</Nav.Link>
              </LinkContainer>

              <LinkContainer to="/contact">
                <Nav.Link className="nav-link-upp">Contact</Nav.Link>
              </LinkContainer>

              <LinkContainer to="/order-tracking">
                <Nav.Link className="nav-link-upp">Order Tracking</Nav.Link>
              </LinkContainer>

              <LinkContainer to="/shipping-rates">
                <Nav.Link className="nav-link-upp">Shipping Rates</Nav.Link>
              </LinkContainer>

              {/* Admin quick link to create product (optional) */}
              {userInfo && userInfo.admin && (
                <LinkContainer to="/new-product/">
                  <Nav.Link className="nav-link-upp">Add Product</Nav.Link>
                </LinkContainer>
              )}
            </Nav>

            {/* remove login/user dropdown from here per your request */}
            {/* If you still want a text "Admin" link somewhere:
            {userInfo && userInfo.admin && (
              <LinkContainer to="/admin">
                <Nav.Link className="nav-link-upp">Admin</Nav.Link>
              </LinkContainer>
            )} */}
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* ========== SEARCH MODAL ========== */}
      <Modal show={showSearch} onHide={closeSearch} centered size="lg">
        <Modal.Body className="p-4">
          <SearchBarForProducts />
        </Modal.Body>
      </Modal>
    </header>
  );
}

export default NavBar;
